text56907.arrCSSStyles.push('span.text56907Font1 { font-size:19px; font-family:"Arial", sans-serif; color:#333333;}');

text56907.addInnerText('<div id=\"text56907\"><a id=\"text56907anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<p  legLH=\"1.384\" style=\"margin-left:0px;text-indent:0px;line-height:1.384;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text56907Font1\" style=\"position:relative;top:-2px;\" >Økologisk mat er produsert på en mest mulig miljøvennlig måte uten bruk av kunstgjødsel, sprøytemidler, minimal bruk av tilsetningsstoffer og god velferd for husdyrene.\n</span ></p >\n<p  legLH=\"1.384\" style=\"margin-left:0px;text-indent:0px;line-height:1.384;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text56907Font1\" style=\"position:relative;top:-2px;\" >I Norge er det en målsetning at 15% av matproduksjon og matforbruket skal være økologisk innen 2020, og vi har fortsatt en vei å gå før vi når dette målet. Økologisk landbruk fører til et økt biologisk mangfold, men det er foreløpig ikke noe som viser at økologiske produkter er sunnere.\n</span ></p >\n<p  legLH=\"1.384\" style=\"margin-left:0px;text-indent:0px;line-height:1.384;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text56907Font1\" style=\"position:relative;top:-2px;\" >&nbsp;\n</span ></p >\n<p  legLH=\"1.384\" style=\"margin-left:0px;text-indent:0px;line-height:1.384;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text56907Font1\" style=\"position:relative;top:-2px;\" >Noe som økologisk landbruk kritiseres for, er spørsmålet om denne produksjonsmetoden er i stand til å mette jordens befolkning. Et slikt jordbruk gir et større avlingstap enn ved vanlig landbruk. Man må derfor bruke et større areal for å få samme mengde mat. Noen forskere mener imidlertid at hvis kjøttforbruket og matsvinnet reduseres, vil økologisk mat klare å mette alle.</span ><span class=\"text56907Font2\" style=\"background-color:transparentposition:relative;top:-2px;\" >\n</span ></p >\n</div>\n');
text56907.build()
